# Sequência de DNA fornecida
dna_sequence = ""

# Criando um dicionário para armazenar a contagem de cada caractere
nt_comp = {}

# Iterando sobre cada caractere único na sequência e contando o número de ocorrências
for nucleotide in set(dna_sequence):
    nt_comp[nucleotide] = dna_sequence.count(nucleotide)

# Calculando a composição total de nucleotídeos
total_nucleotides = sum(nt_comp.values())

# Calculando o conteúdo de GC
gc_content = (nt_comp.get('G', 0) + nt_comp.get('C', 0)) / total_nucleotides * 100

# Exibindo os resultados
print("Contagem de Nucleotídeos:", nt_comp)
print("Composição total de nucleotídeos:", total_nucleotides)
print(f"Conteúdo de GC: {gc_content:.2f}%")

